NewsFeed\httpsfeedqgisorg\31\content="<p>Have you been missing all the buzz and excitement around the 6-monthly in-person meetups we used to hold? Perhaps you live far away from Europe and could never join these meetups in person? Well we have great news for you! Starting August Friday 28th 2020, we will be holding day-long <strong>virtual</strong> meetups on the last friday of each month. Come and chat to the developers and maintainers of QGIS and it's related infrastructure. Talk to other users to share tips and tricks. Collaborate with other like-minded users to work on inititives for yourselves and your community. Attendance is free and all are welcome regardless of your experience or past involvment in the project. <strong>Double-click on this news feed entry to find out more!</strong></p>"
NewsFeed\httpsfeedqgisorg\31\imageUrl=https://feed.qgis.org/media/feedimages/2020/08/27/nodebo.jpg
NewsFeed\httpsfeedqgisorg\31\link="@Variant(\0\0\0\x11\0\0\0=http://blog.qgis.org/2020/08/21/say-hello-to-the-qhackfriday/)"
NewsFeed\httpsfeedqgisorg\31\sticky=false
NewsFeed\httpsfeedqgisorg\31\title=QGIS Monthly Virtual Fridays!
NewsFeed\httpsfeedqgisorg\32\content="<p></p>\r\n<p>QGIS will drop 32-bit support on Windows after the QGIS 3.16 release when we update our Qt dependencies to Qt 5.15. The update to Qt 5.15 is an important step towards staying in sync with Qt developments. Qt 5.15 is the minimum version that will provide forward compatibility with Qt 6. By updating to 5.15, we, therefore, ensure that QGIS is future proof. <strong>Please double-click this entry to find out more.</strong></p>"
NewsFeed\httpsfeedqgisorg\32\imageUrl=https://feed.qgis.org/media/feedimages/2020/11/03/logo_evolution.jpg
NewsFeed\httpsfeedqgisorg\32\link=@Variant(\0\0\0\x11\0\0\0\x44https://blog.qgis.org/2020/10/15/phasing-out-32-bit-support-in-qgis/)
NewsFeed\httpsfeedqgisorg\32\sticky=false
NewsFeed\httpsfeedqgisorg\32\title=Planned end of life for Windows 32-Bit Support
NewsFeed\httpsfeedqgisorg\48\content="<p>We are extremely proud to present QGIS 3.24 to you, our loyal users. This release is jam-packed with great new features, bug fixes and cartography tools. We named this release 'Tisler' after a small Norwegian island that was a favourite visiting place of H&aring;vard Tveite, who passed away in May 2021. H&aring;vard was a very active member of the QGIS community, providing valuable input to the documentation, developing numerous plugins, and taking care of the QGIS Resources Sharing Repository to name just a few of his contributions. The map on the QGIS 3.24 splash screen is an orienteering map that H&aring;vard has created. He liked spending some time each year map-making at Tisler. To find out more about the wonderful features included in QGIS 3.24, please <strong>double click this entry</strong>.</p>"
NewsFeed\httpsfeedqgisorg\48\imageUrl=https://feed.qgis.org/media/feedimages/2022/02/25/qgis_O58OBup.jpg
